import React from 'react';
import SignUpData from '../signupData'
import Button from '../../../../general/button/button.js'
import Persondetails from '../../../../general/form_details/person_details';



class SignUpForm extends React.Component{
  constructor(props){
    super(props)
  }
  render(){
    return(
      <div>
        {SignUpData.map((item)=>{
          <label class="control-label col-sm-3">Gender</label>
          return(
              (("check" in item)==1)?
              <div class="form-group">
                   <div class="col-sm-6">
                       <div class="row">
                           <div class="col-sm-4">
                               <label class="radio-inline">
                                   <input type="radio" id="femaleRadio" value="Female"/>{item.check}
                               </label>
                           </div>
                       </div>
                   </div>
               </div>
               :
            <div>
              <div className="contact form-group mt-5 row">
                <label for={item.for} className="col-sm-2 col-form-label">{item.value}</label>
                <div className="col-sm-4">
                  <input type={item.type} className="form-control" id={item.id} name={item.name}/>
                </div>
              </div>
            </div>
            )
          })}
    </div>
    )
  }
}
export default SignUpForm
